function validateForm1() {
  return "" == document.javascriptform1.txtFirstName.value ||
    "<%=strLoc_Inquiry_Your_First_Name%>" ==
      document.javascriptform1.txtFirstName.value
    ? (alert("Please enter your first name."),
      document.javascriptform1.txtFirstName.focus(),
      !1)
    : "" == document.javascriptform1.txtEmail.value ||
      "<%=strLoc_Inquiry_Your_Email%>" ==
        document.javascriptform1.txtEmail.value
    ? (alert("Please enter your email address."),
      document.javascriptform1.txtEmail.focus(),
      !1)
    : "" == document.javascriptform1.txtEmail.value ||
      (-1 != document.javascriptform1.txtEmail.value.indexOf("@", 0) &&
        -1 != document.javascriptform1.txtEmail.value.indexOf(".", 0))
    ? !0
    : (alert("Your email address appears incorrect... please re-enter it.."),
      document.javascriptform1.txtEmail.focus(),
      !1);
}
